const App = () =>{

  const [count, setCount] = useState(0);

  const IncNum = () =>{
    setCount(count + 2);
  }
  
  return(
    <>
    <div>
      <h1> {count} </h1>
      <button onClick={IncNum}> Click Me </button>
    </div>
    </>
  )
} 

export default App;


